INSERT INTO `blog` VALUES (4,'5 Useful tips for Preventing Fever','5-useful-tips-for-preventing-fever','picfolder/diet.png','<p class=\"western\"><strong>5 Useful tips for Preventing Fever</strong></p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">Fever is the body&rsquo;s response to fight against infections caused by bacteria or viruses. Fever can also be caused by cold, sunburn or from getting immunizations. Anyone can get fever regardless of the age. People with weak immune system tend to have fever more often than others.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">A fever is the body&rsquo;s natural behavior in response to fighting off the viruses and bacteria by fighting the germs and limiting their ability to reproduce. It also helps in burning away the toxins from the body.</p>\r\n<p class=\"western\">If you are having a fever, you may experience the following symptoms:</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">a headache</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">sweating</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">loss of appetite</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">high body temperature</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">vomiting</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">rash</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">feeling weak or lightheaded</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">If your fever is accompanied by rashes, you should consult your doctor. It is important that your doctor determine the root cause of the fever. Other symptoms like vomiting, nausea may resolve quickly with the medical attention. If your fever exceeds 103 degrees, you must seek immediate medical attention.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\"><strong>When to see a doctor</strong></p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">How and when you should treat a fever is generally determined by your age. It can lead to serious complications if left untreated in infants, young children, older adults and people with the weak immune system. Infants up to 3 months should be seen by a doctor if they have a high fever.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">Children ages 2 to 7 years generally don&rsquo;t need medications to reduce fever under 102 degrees F.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">Adults typically don&rsquo;t need medications for a fever under 102 degrees F. Fever above that temperature can be treated with medications.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\"><strong>Prevention</strong></p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">You can use these 5 tips to prevent fever:</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\"><strong>1. Wash your hands</strong></p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">Mouth is the primary channel where viruses and bacteria enter our body. These germs enter our body and cause fever. To avoid this, wash your hands frequently, especially after using the bathroom or after touching inanimate objects like bathroom door handles and faucets in public places. Also, try to stop touching your face. This can allow germs to easily enter your body.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\"><strong>2. Go to bed early</strong></p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">Get a good sleep to keep your immune system strong. A strong immune system keeps helps you to fight common diseases. At night, our body&rsquo;s self-repair mechanism works which boost the metabolism and the immune system of the body.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\"><strong>3. Eat healthy food</strong></p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">Get a healthy diet with a lot of vitamins. This will also help you to keep your immune system strong. Cold and flu are common in the rainy seasons. Try to eat healthy and seasonal fruits and vegetables. A healthy diet also keeps you away from many diseases.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\"><strong>4. Exercise daily</strong></p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">Regular exercise is another immune system booster. Exercise keeps you healthy and helps you to fight common diseases. You can hit the gym, try aerobics, yoga, a morning walk or any other form of exercise to keep healthy.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\"><strong>5. Stay hydrated</strong></p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">Drink lots of water to stay hydrated. Drink different kinds of fluids to fulfill your body needs. Make sure that you drink boiled water only as water also contains germs that can enter our body and make us sick.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">Despite taking all the preventions, if someone gets a fever, here are some of the tips you can use to break the fever:</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">Measure your temperature and take an assessment of your symptoms. If your temperature is above 100 degrees F, you have a fever.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">Stay in bed and take rest. Avoid doing physical activity or work.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">Take medications to reduce fever if the fever exceeds 102 degrees F.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">Take bath using lukewarm water to make you more comfortable. Avoid cold baths, ice cube baths as they can be dangerous in a high fever.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>&nbsp;</li>\r\n</ul>\r\n</ul>\r\n<p class=\"western\">If the temperature is consistent, you must consult your doctor.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\"><strong>Conclusion</strong></p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">Running a fever is usually nothing to worry about. It is important to follow the guidelines for treating the fever, especially for the young children. Try to include the tips discussed in this article in your lifestyle and you can definitely stay away from high fever.</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">&nbsp;</p>\r\n<p class=\"western\">&nbsp;</p>',' Useful tips for Preventing Fever','Useful tips for Preventing Fever','<p>Useful tips for Preventing Fever</p>','2018-09-28',NULL,NULL);
